import React from "react";

function Footer() {
    return(
        <footer className="myfooter">
          <a href="https://github.com/anupamroy8/conduit-react" target="_blank" rel="noopener noreferrer">
            <i className="fa fa-github" aria-hidden="true"></i>
            Fork on GitHub
          </a>
        </footer>
    )
}

export default Footer;
